  input: 'TEXT,F3XN,,"Dear Madam or Sir:  In July of 2001,  we became aware of an
    independent expenditure for printing of ballot cards by Northern Printing.  Presumably
    the ballot cards were printed and distributed in early November of 2000, prior
    to the general election.  Because the printing was coordinated by an affiliate,
    we were not aware of the expenditure until we received the bill from Northern
    Printing, which we promptly paid on July 13, 2001.  After consulting with Thomas
    Maxwell, FEC Reports Analyst on how to accurately report this expenditure, he
    suggested this explaination text and for the expenditure to be included in the
    current report instead of amending past reports.  Thank you, Angela Alexander
    Savino"'
